    return (
        <div className="header-component">
            <div className="buttons">
                <button class="btn-transparent " style={{
                    'color':'var(--orange)',
                    'padding': '0px',
                    'margin-left': '20px',
                    'height': '100%'
                }}>
                    Home
                </button>
                <button class="btn-transparent" style={{
                    'color':'var(--orange)',
                    'padding': '0px',
                    'margin-left': '20px',
                    'height': '100%'
                }}>
                    Home
                </button>
            </div>
        </div>
    );
}
